<script>
	var timer = document.getElementById('timer');
	
	function addZero(x, n) {
	  while (x.toString().length < n) {
	    x = "0" + x;
	  }
	  return x;
	}
	
	function time() {
	  const d = new Date();
	  let h = addZero(d.getHours(), 2);
	  let m = addZero(d.getMinutes(), 2);
	  let s = addZero(d.getSeconds(), 2);
	  let ms = addZero(d.getMilliseconds(), 4);
	  let time = h + ":" + m + ":" + s + ":" + ("0" + ms).substr(2, 2);
	  timer.textContent = time;
	}
	setInterval(time, 0.1);
</script>
<script>
	var today = new Date();
	var dd = String(today.getDate()).padStart(2, '0');
	var mm = today.toLocaleString('default', {
	  month: 'long'
	});
	var yyyy = today.getFullYear();
	today = mm + ' ' + dd + ' ' + yyyy;
	document.getElementById('date').textContent = (today);
</script>
<script>
	const logos = document.querySelectorAll('.image-logo');
	window.onload = () => generateRandomPicture(logos);
	
	function generateRandomPicture(array) {
	  let randomNum = Math.floor(Math.random() * logos.length);
	  logos[randomNum].style.display = "block";
	}
</script>
